import React, { useState } from "react";
import SearchIcon from "@mui/icons-material/Search";
import ShoppingCartOutlinedIcon from "@mui/icons-material/ShoppingCartOutlined";
import { Link } from "react-router-dom";
import "./NavigationBar.css";

const NavigationBar = () => {
  const [hoveredItem, setHoveredItem] = useState(null);
  const [isSearchOpen, setIsSearchOpen] = useState(false);
  const [searchQuery, setSearchQuery] = useState("");
  const [products, setProducts] = useState([]);
  const [cartCount, setCartCount] = useState(0);

  const toggleSearch = () => setIsSearchOpen(!isSearchOpen);

  const handleSearch = async (e) => {
    e.preventDefault();
    const response = await fetch(`/api/products?search=${searchQuery}`);
    const data = await response.json();
    setProducts(data);
  };
  const handleMouseEnter = (item) => {
    setHoveredItem(item);
  };

  const handleMouseLeave = () => {
    setHoveredItem(null);
  };

  return (
    <div className="navbar-container">
      {/* Black bar */}
      <div className="navbar-black">
        <div
          className="navbar-item"
          onMouseEnter={() => handleMouseEnter("new")}
          onMouseLeave={handleMouseLeave}
        >
          TË REJA
        </div>
        <div
          className="navbar-item"
          onMouseEnter={() => handleMouseEnter("clothing")}
          onMouseLeave={handleMouseLeave}
        >
          VESHJE
        </div>
        <div
          className="navbar-item"
          onMouseEnter={() => handleMouseEnter("shoes")}
          onMouseLeave={handleMouseLeave}
        >
          KËPUCË
        </div>
        <div
          className="navbar-item"
          onMouseEnter={() => handleMouseEnter("brands")}
          onMouseLeave={handleMouseLeave}
        >
          MARKA
        </div>
        <div
          className="navbar-item"
          onMouseEnter={() => handleMouseEnter("bags")}
          onMouseLeave={handleMouseLeave}
        >
          ÇANTA
        </div>
        <div
          className="navbar-item"
          onMouseEnter={() => handleMouseEnter("accessories")}
          onMouseLeave={handleMouseLeave}
        >
          AKSESORË
        </div>
        <div
          className="navbar-item"
          onMouseEnter={() => handleMouseEnter("sale")}
          onMouseLeave={handleMouseLeave}
        >
          SALE
        </div>
        <div
          className="navbar-item"
          onMouseEnter={() => handleMouseEnter("outlet")}
          onMouseLeave={handleMouseLeave}
        >
          OUTLET
        </div>

          <div className="search-container navbar-item">
            <SearchIcon className="icon" onClick={toggleSearch} />
            {isSearchOpen && (
              <input
                type="text"
                placeholder="Search for products..."
                className="search-input"
                value={searchQuery}
                onChange={(e) => setSearchQuery(e.target.value)}
              />
            )}
          </div>

          <Link to="/cart" className="cart-icon">
            <ShoppingCartOutlinedIcon className="icon" />
            <span className="cart-count">{cartCount}</span>
          </Link>

      </div>

      <div className="search-cart-container">
        <div className="search-container">
          <SearchIcon className="icon" onClick={toggleSearch} />
          {isSearchOpen && (
            <input
              type="text"
              placeholder="Search for products..."
              className="search-input"
              value={searchQuery}
              onChange={(e) => setSearchQuery(e.target.value)}
            />
          )}
        </div>

        <Link to="/cart" className="cart-icon">
          <ShoppingCartOutlinedIcon className="icon" />
          <span className="cart-count">{cartCount}</span>
        </Link>
      </div>
      {/* White dropdown */}
      <div className={`dropdown-container ${hoveredItem ? "active" : ""}`}>
        {hoveredItem === "accessories" && (
          <div className="dropdown-content">
            <div className="dropdown-column">
              <a href="#">Rripa</a>
              <a href="#">Kapelet</a>
              <a href="#">Çantë Kozmetike</a>
              <a href="#">Çorape</a>
              <a href="#">Të Tjera</a>
            </div>
            <div className="dropdown-column">
              <a href="#">Kapucë Dhe Dorashka</a>
              <a href="#">Syze Dielli</a>
              <a href="#">Portofol</a>
              <a href="#">Shaje</a>
            </div>
            <div className="dropdown-image">
              <img src="path_to_image" alt="Scotch & Soda" />
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default NavigationBar;
